import { AppBar, Toolbar, IconButton, styled } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";

const Header = styled(AppBar)`
  background: red;
`;
const ptag = styled("p")`
  font-size: 40px;
`;

const NavBar = () => {
  return (
    <Header>
      <Toolbar>
        <ptag>Hello</ptag>
        <ptag>Hello</ptag>
        <p>Hello</p>
      </Toolbar>
    </Header>
  );
};

export default NavBar;
